    return (
        <tr>
            <td>{lieu}</td>
            <td>{lundi_a}</td>
            <td>{mardi_a}</td>
            <td>{mercredi_a}</td>
            <td>{jeudi_a}</td>
            <td>{vendredi_a}</td>
            <td>{samedi_a}</td>
            
        </tr>
    );
};

export default ServiceShow;
